  }

  .social {
    //margin-right: 1em;
    a {
      font-size: 0.5em;
      margin-right: 1em;
    }
  }

  > a:last-child {
    margin-right: 0.5em;
  }

  a, .header-category {
    vertical-align: middle;
    display: inline-block;
    color: white;
    text-decoration: none;
  }
  > a, .header-category {
    margin-right: 1em;
    font-size: 1.25em;
  }

  .header-category {
    position: relative;
    cursor: default;

    .dropdown-content {
      position: absolute;
      top: 1.5em;
      right: 0;
      font-size: 0.85em;
      width: 9em;
      text-align: right;
      a {
        display: block;
        padding-top: 0.25em;
      }

      visibility: hidden;
      opacity: 0;
      transition-property: opacity, visibility;
      transition-duration: .4s, 0s;
      transition-delay: 0s, .4s;
    }
  }

  .header-category:hover .dropdown-content {
    visibility: visible;
    opacity: 1;
    transition-delay: 0s, 0s;
  }

  @media @screen-sm {
    a {
      display:inline-block;
      width: calc(100% / 3);
      margin:0;
    }
    .social {
      display:none;
    }
  }

  @media @screen-xs {
    text-align: center;
    .social {
      display:none;
    }
  }

  .hamburger {
    display: none;
    background-color: rgba(0,0,0,0);
    border: none;
  }

}
